<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Movie Download Search</title>
  <link href="https://fonts.googleapis.com/css2?family=Outfit:wght@400;600;800&amp;display=swap" rel="stylesheet" />
<style>
  :root {
    --bg: #0e1015;
    --card: rgba(255, 255, 255, 0.05);
    --accent: #4a90e2;
    --accent2: #8e44ad;
    --text: #f0f0f0;
    --muted: #888;
  }

  * {
    box-sizing: border-box;
  }

  body {
    margin: 0;
    font-family: 'Outfit', sans-serif;
    background: var(--bg);
    color: var(--text);
  }

  header {
    text-align: center;
    padding: 40px 20px;
    font-size: 2.5rem;
    font-weight: 800;
    background: linear-gradient(to right, var(--accent), var(--accent2));
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
  }

  footer {
    text-align: center;
    padding: 30px 20px;
    font-size: 0.9rem;
    color: var(--muted);
  }

  .container {
    max-width: 900px;
    margin: 0 auto;
    padding: 20px;
  }

  input,
  button {
    padding: 14px;
    border-radius: 8px;
    font-size: 1rem;
    border: none;
    outline: none;
    transition: all 0.3s ease;
  }

  input {
    width: 70%;
    background: var(--card);
    color: var(--text);
    border: 1px solid #333;
    margin-right: 10px;
  }

  input::placeholder {
    color: var(--muted);
  }

  button {
    background: linear-gradient(to right, var(--accent), var(--accent2));
    color: white;
    font-weight: bold;
    cursor: pointer;
  }

  button:hover {
    filter: brightness(1.2);
  }

  .movie {
    background: var(--card);
    border-radius: 16px;
    padding: 20px;
    margin-top: 20px;
    backdrop-filter: blur(8px);
    box-shadow: 0 0 15px rgba(255, 255, 255, 0.05);
    transition: 0.3s;
  }

  .movie:hover {
    transform: scale(1.02);
  }

  .movie strong {
    color: var(--accent);
  }

  .dlink a {
    display: inline-block;
    margin-top: 10px;
    background: var(--accent);
    color: white;
    text-decoration: none;
    padding: 10px 18px;
    border-radius: 6px;
    font-weight: 600;
    transition: all 0.3s;
  }

  .dlink a:hover {
    background: var(--accent2);
  }

  .status {
    margin-top: 10px;
    color: var(--muted);
  }

  @media (max-width: 600px) {
    input {
      width: 100%;
      margin: 0 0 10px 0;
    }

    button {
      width: 100%;
    }
  }

  .telegram-icon-center {
    display: flex;
    justify-content: center;
    align-items: center;
    margin: 30px 0;
  }

  .telegram-icon {
    background: linear-gradient(to right, #4a90e2, #8e44ad);
    width: 64px;
    height: 64px;
    border-radius: 50%;
    display: flex;
    align-items: center;
    justify-content: center;
    box-shadow: 0 0 12px rgba(138, 43, 226, 0.5);
    animation: pulse 2s infinite ease-in-out;
    transition: transform 0.3s ease;
    text-decoration: none;
  }

  .telegram-icon:hover {
    transform: scale(1.1);
  }

  .telegram-icon svg {
    width: 28px;
    height: 28px;
  }

  @keyframes pulse {
    0% {
      box-shadow: 0 0 0 30px rgba(138, 43, 226, 0.4);
    }
    70% {
      box-shadow: 0 0 0 80px rgba(138, 43, 226, 0);
    }
    100% {
      box-shadow: 0 0 0 0 rgba(138, 43, 226, 0);
    }
  }

  #loadingOverlay {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: white;
    color: black;
    display: flex;
    justify-content: center;
    align-items: center;
    z-index: 9999;
    flex-direction: column;
    font-family: 'Outfit', sans-serif;
  }

  #loadingOverlay h2 {
    font-size: 1.8rem;
    margin-bottom: 10px;
  }

  #loadingOverlay p {
    font-size: 1.2rem;
    color: #555;
  }
</style>

</head>

  function parseRawData(raw) {
    return raw.trim().split('---').map(block => {
      const lines = block.trim().split('\n');
      const nameLine = lines.find(l => l.startsWith('File Name:')) || '';
      const sizeLine = lines.find(l => l.startsWith('File Size:')) || '';
      const linkLine = lines.find(l => l.startsWith('Download Link:')) || '';
      return {
        name: nameLine.replace('File Name:', '').trim(),
        size: sizeLine.replace('File Size:', '').trim(),
        link: linkLine.replace('Download Link:', '').trim(),
        extractedLinks: null,
        fetching: false,
        fetched: false
      };
    }).filter(item => item.name && item.link);
  }

  const data = parseRawData(rawData);
  const resultsDiv = document.getElementById('results');
  const input = document.getElementById('search');
  const button = document.getElementById('search-btn');

  async function extractDownloadLinks(item, statusEl, attempt = 1) {
    const proxy = "https://api.allorigins.win/raw?url=";
    item.fetching = true;

    try {
      const res = await fetch(proxy + encodeURIComponent(item.link));
      const html = await res.text();
      const doc = new DOMParser().parseFromString(html, "text/html");

      const links = [...doc.querySelectorAll(".dlink a")].filter(a =>
        a.textContent.toLowerCase().includes("download")
      );

      if (links.length > 0) {
        item.extractedLinks = links.map(a =>
          `<div class="dlink"><a href="${a.href}" target="_blank">${a.textContent}</a></div>`
        ).join("");
        item.fetched = true;
        statusEl.textContent = ' Ready';
      } else if (attempt < 3) {
        setTimeout(() => extractDownloadLinks(item, statusEl, attempt + 1), 700);
      } else {
        statusEl.textContent = '⚠️ No links';
      }
    } catch (err) {
      if (attempt < 3) {
        setTimeout(() => extractDownloadLinks(item, statusEl, attempt + 1), 1000);
      } else {
        statusEl.textContent = '⚠️ Failed';
      }
    } finally {
      item.fetching = false;
    }
  }

  function displayResults(keyword) {
    resultsDiv.innerHTML = '';
    const filtered = data.filter(item =>
      item.name.toLowerCase().includes(keyword.toLowerCase())
    );

    if (filtered.length === 0) {
      resultsDiv.innerHTML = '<p>No results found.</p>';
      return;
    }

    filtered.forEach(item => {
      const div = document.createElement('div');
      div.className = 'result';

      const statusSpan = document.createElement('span');
      statusSpan.textContent = '🔄 Extracting...';
      statusSpan.style.float = 'right';

      const dlinksContainer = document.createElement('div');
      dlinksContainer.className = 'dlinks';

      div.innerHTML = `
        <strong>File Name:</strong> ${item.name}<br>
        <strong>File Size:</strong> ${item.size}<br>
       
      `;
      div.appendChild(statusSpan);
      div.appendChild(dlinksContainer);

      extractDownloadLinks(item, statusSpan);

      div.addEventListener('click', () => {
        if (item.extractedLinks) {
          dlinksContainer.innerHTML = item.extractedLinks;
          dlinksContainer.style.display = 'block';
        } else {
          dlinksContainer.innerHTML = '<em>⏳ Still extracting...</em>';
          dlinksContainer.style.display = 'block';
        }
      });

      resultsDiv.appendChild(div);
    });
  }

  button.addEventListener('click', () => {

  input.addEventListener('keypress', (e) => {
